import {BrowserRouter, Router, Route} from 'react-router-dom';
import Navbar from './components/Navbar';
import Home from './pages/Home';

function App() {
  const user = 1
  return (
    <div>
      <BrowserRouter>
        <Navbar/>
        <Router>
          <Route path='/'
              element={ user ? <Home/>: <Navigate to="/login"/> }/>
        </Router>
      </BrowserRouter>
    </div>

  );
}

export default App;
